import subprocessfrom config import RESOURCE_DIR, INPUT_DIR, PCMIDS_FILE_PATHdef read_and_extract_list(file_path):    with open(file_path, 'r') as file:        content = file.read()        elements = content.strip("[]").split(',')        elements = [element.strip().strip("'") for element in elements]        return elements# Path to the uploaded file, use full pathfile_path = PCMIDS_FILE_PATH# Test the functionextracted_elements = read_and_extract_list(file_path)def download_files_from_s3(id_list):    for _id in id_list:        command = f"aws s3 cp s3://pmc-oa-opendata/oa_comm/xml/all/{_id}.xml {INPUT_DIR} --no-sign-request"        subprocess.run(command, shell=True)print("Download starts soon!")download_files_from_s3(extracted_elements)print("Download completed!")